import React from 'react';
import styles from './header.module.css'
import HeaderCartBtn from './headerCartBtn';

const Header = () => {
    return (
        <header className={styles.header}>
            <h1 className={styles.title}>ReactMeals</h1>
            <HeaderCartBtn/>
        </header>
    );
};





export default Header;
